Add the href attribute to the , pointing to style.css
Add the rel attribute to the , setting it to stylesheet

The added code should look something like this:




Styling the Full Page
Now it's time to get into the styles! First, style the whole page.

Open the style.css file for editing
Add the body selector and curly brackets
The  is the HTML element that contains everything!


Add the following properties:
color
background
font-family
