Run the project to see the page change! The added CSS should look like this:
body {
  color: pink;
  background: black;
  font-family: arial;
  font-size: 14px;
}

Highlighting Some List Items
HTML elements can be selected in CSS by their type, but it's also possible to style only certain elements. To highlight some of the  elements, use the class attribute/selector.
HTML: Adding the class Attribute
Start by updating the HTML to designate certain  elements as highlighted.

Open the index.html file for editing
Find two of your favorite hobbies in the list
Add the class attribute to each of them, set to highlight

It won't change anything yet, but the updated code should look like this:

  Watching TV
  Watching Movies
  Listening to Music


CSS: Selecting by the Class
Now it's time to style those particular elements!

Open the style.css file for editing
Make a new line at the bottom of the page
Under the }


Make a new ruleset to style .highlight
This looks for HTML elements with class="highlight"


In the ruleset, set the background color
Additionally, set the max-width to 120px

Run the project to see the highlights! The added code should look something like this:
.highlight {
  background: darkblue;
  max-width: 120px;
}

Underlining One Header
The class selector is good for when there are multiple elements that should be classified in a certain way. Sometimes, though, it is helpful to identify one element uniquely - this is possible with the id attribute/selector.
HTML: Adding the id Attribute
This works a lot like the class, just with id instead! In the index.html file, find the Form, and add the id attribute set to form-head, like this:
Form

CSS: Selecting by the ID
Next, select that specific heading with CSS. Instead of a . like with classes, ids use #.

Open the style.css file for editing
Add a new ruleset for #form-head
In the ruleset, set the border-bottom property
There are a few options for this - figure out what looks good!



Run the project to see the underlined header! The added code should look something like this:
#form-head {
  border-bottom: 1px solid pink;
}

Just for Fun: More Styles
This next step just shows off some additional styles that can be applied to  elements.
